import React from 'react'
import { useRouteMatch, Link, Switch, Route, HashRouter, NavLink } from 'react-router-dom';
import { AdminPage } from './AdminPage';

interface Props {

}

export const AdminMenu: React.FC<Props> = () => {

    const {url, path} = useRouteMatch();

    return(
        <HashRouter>
            <div>
                <NavLink to={`${url}/properties`}>properties</NavLink>
                <NavLink to={`${url}/sightspots`}>sightspots</NavLink>

                <div className='content'>
                    <Route exact path={`${path}properties`} component={AdminPage} />
                </div>
            </div>
        </HashRouter>
    )
}
